import React from "react";
import "./App.css";
import { Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./components/pages/home/Home";

const SearchBackground = props => {
  return <div className="search-background"></div>;
};

const hideSearchBar = () => {
  const searchBar = document.querySelector(".search-container");
  const navBar = document.querySelector(".navbar");
  const searchBackground = document.querySelector(".search-background");
  navBar.classList.toggle("navbar-hide");
  searchBar.classList.toggle("search-container-active");
  searchBackground.classList.toggle("search-background-active");
  console.log("hide searchbar");
};

function App() {
  return (
    <div className="App">
      <SearchBackground onClick={hideSearchBar} />
      <Navbar />
      <Route path="/home" component={Home} />
    </div>
  );
}

export default App;
